export default class API {
    static imageSend(body){
        return fetch(`http://127.0.0.1:8000/api/`, {
            method: 'POST',
            headers: {
                'Content-Type': 'multipart/form-data'
            },
            body: body
        }).then( resp => resp.json())
    }
}
